import react from "react";
import { Container, Box, Grid } from "@mui/material";
import GenericInputField from "./TextField";

export default function UserEntry() {
  return (
    <>
      <Grid
        container
        direction="column"
        spacing={2}
        justifyContent="center"
        alignItems="center"
        justify="center"
        sx={{
          width: "500px",
          minHeight: "100vh",
          boxShadow:
            "-2px 2px 4px rgba(0, 0, 0, 0.5), 2px -2px 0 rgba(255, 255, 255, 0.9)",
        }}
      >
        <Grid item xs={6}>
          <GenericInputField
            label="FirstName"
            helperText="FirstName"
            errorStatus={false}
          />
        </Grid>
        <Grid item xs={6}>
          <GenericInputField
            label="LastName"
            helperText="LastName"
            errorStatus={false}
          />
        </Grid>
        <Grid item xs={6}>
          <GenericInputField
            label="Email"
            helperText="Email"
            errorStatus={false}
          />
        </Grid>
      </Grid>
    </>
  );
}
